?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: Times New Roman;">История этой знаменитейшей часовой компании во многом похожа и на истории других швейцарских компаний. Все началось с того, что в 1832 году часовщик Август Агассиц переехал в городок под названием Сент-Имье. После переезда он устроился на работу в небольшой магазин, который специализировался на продаже запчастей для часов. Несколько лет спустя, вместе с двумя друзьями он решил основать собственную компанию, которую назвал «Comptor Raiguel Jeune Cie». Но, спустя десять лет, оба друга решили покинуть компанию, и Агассиц стал полноценным владельцем компании. А в 1862 году он решает передать руководство компанией своему племяннику, которого звали Эрнест Франсилльон. Современное название далось бренду в 1866 году. Эрнест Франсилльон покупает участки земли в одном неприметном местечке, которое называлось Les Longines. Вскоре, на этом месте была построена небольшая фабрика по производству часов. И уже на следующий год, строительство фабрики дало свои результаты. В 1867 году был создан механизм Longines (стоит отметить, что это был первый механизм, который функционировал при помощи заводной головки). В этом же году, Франсилльон демонстрирует свои часы на Парижской выставке и занимает в не 3-е место. Кстати, компания Longines является своеобразным рекордсменом по наградам среди других часовых производителей. В ее копилке наград присутствуют 28 золотых медалей и 10 Гран-при. На данный момент, Longines это известнейший по всему миру бренд, который, только своим названием, может рассказать о Вас. </span></span></p>
 
